import React from 'react'
import pic4 from'./pic4.jpeg'
import pic5 from'./pic5.jpeg'
import pic6 from'./pic6.jpeg'
import pic7 from'./pic7.jpeg'
import Array from './Arraypics'
import { useState } from 'react'

export default function Projects() {

      const [hovera , sethover]=useState(false);

      const mouse=(data)=>{
            console.log(data)
            sethover(true);
      }
      const [Array , setarray]=useState([

            { 
                image:pic4,
                url:'https://inspiring-clafoutis-b5601d.netlify.app/'
            },
            { 
                image:pic5,
                url:''

            },
            { 
                image:pic6,
                url:''
            },
            { 
                image:pic7,
                url:''
            },
        ])
  return (
    <div className='Projects mainabout'>
       
    <h1 data-aos='flip-right'>Projects</h1>

    <div className='proimages '>{Array.map((val)=>{
return(
     <>
      <div className="imagess" onClick={()=>mouse(val)}><img src={val.image} alt="" />
      
      <div className={hovera?"hover":'notactive'}>
      <i class="fa fa-eye"></i>
      <i class="fa fa-github"></i>

      </div>
      </div>
     
     </>
)

    })}</div>
    </div>
  )
}
